import React, { useState } from 'react';
import { useAuth } from '@/contexts/AuthContext';
import { useNavigate, useLocation } from 'react-router-dom';

export function Login() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [isLoading, setIsLoading] = useState(false);
    const [error, setError] = useState<string | null>(null);

    const { signInWithPassword } = useAuth();
    const navigate = useNavigate();
    const location = useLocation();

    // Redirigir a la página anterior o al dashboard
    const from = location.state?.from?.pathname || '/';

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();
        setIsLoading(true);
        setError(null);

        try {
            const { error } = await signInWithPassword(email, password);

            if (error) {
                throw error;
            }

            navigate(from, { replace: true });
        } catch (err: any) {
            setError(err.message || 'Error al iniciar sesión');
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-indigo-100 to-purple-100 p-4">
            <div className="bg-white p-8 rounded-2xl shadow-xl w-full max-w-md border border-gray-100">
                <div className="text-center mb-8">
                    <h1 className="text-3xl font-bold text-gray-900 mb-2">CasaGestión</h1>
                    <p className="text-gray-500">Bienvenido de nuevo</p>
                </div>

                {error && (
                    <div className="bg-red-50 border-l-4 border-red-500 p-4 mb-6 rounded-md">
                        <p className="text-red-700 text-sm">{error}</p>
                    </div>
                )}

                <form onSubmit={handleSubmit} className="space-y-6">
                    <div>
                        <label className="block text-sm font-medium text-gray-700 mb-1">
                            Email
                        </label>
                        <input
                            type="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-indigo-500 focus:border-transparent transition-all outline-none"
                            placeholder="tu@email.com"
                            required
                        />
                    </div>

                    <div>
                        <label className="block text-sm font-medium text-gray-700 mb-1">
                            Contraseña
                        </label>
                        <input
                            type="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-indigo-500 focus:border-transparent transition-all outline-none"
                            placeholder="••••••••"
                            required
                        />
                    </div>

                    <button
                        type="submit"
                        disabled={isLoading}
                        className={`w-full py-3 px-4 border border-transparent rounded-lg shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 transition-colors ${isLoading ? 'opacity-75 cursor-not-allowed' : ''
                            }`}
                    >
                        {isLoading ? (
                            <span className="flex items-center justify-center">
                                <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                                    <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                                    <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                                </svg>
                                Iniciando sesión...
                            </span>
                        ) : (
                            'Iniciar Sesión'
                        )}
                    </button>
                </form>

                <div className="mt-6 text-center text-sm text-gray-500">
                    ¿Problemas para acceder? Contacta al administrador.
                </div>
            </div>
        </div>
    );
}

import { createContext, useContext, useEffect, useState } from 'react';
import { User, Session, AuthError } from '@supabase/supabase-js';
import { getSupabaseClient } from '../config/supabase';
import { logError } from '@/utils/logger';

// ============================================================================
// TIPOS
// ============================================================================

export type UserRole = 'admin' | 'viewer';

interface AuthContextType {
    user: User | null;
    session: Session | null;
    role: UserRole | null;
    loading: boolean;
    error: AuthError | null;
    signIn: (email: string) => Promise<{ error: AuthError | null }>;
    signUp: (email: string, password: string) => Promise<{ error: AuthError | null }>;
    signInWithPassword: (email: string, password: string) => Promise<{ error: AuthError | null }>;
    signOut: () => Promise<{ error: AuthError | null }>;
    isAdmin: boolean;
}

// ============================================================================
// CONTEXTO
// ============================================================================

const AuthContext = createContext<AuthContextType | undefined>(undefined);

// ============================================================================
// PROVEEDOR
// ============================================================================

export function AuthProvider({ children }: { children: React.ReactNode }) {
    const [user, setUser] = useState<User | null>(null);
    const [session, setSession] = useState<Session | null>(null);
    const [role, setRole] = useState<UserRole | null>(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState<AuthError | null>(null);

    // Función auxiliar para obtener el rol
    const fetchUserProfile = async (userId: string) => {
        try {
            const supabase = getSupabaseClient();
            const { data, error } = await supabase
                .from('profiles')
                .select('role')
                .eq('id', userId)
                .single();

            if (error) throw error;
            if (data) setRole(data.role as UserRole);
        } catch (err) {
            console.error('Error fetching user profile:', err);
            setRole('viewer'); // Por seguridad, rol por defecto es el más restringido
        }
    };

    useEffect(() => {
        let mounted = true;
        let authSubscription: { unsubscribe: () => void } | null = null;

        async function initializeAuth() {
            try {
                const supabase = getSupabaseClient();

                // 1. Obtener sesión actual
                const { data: { session }, error: sessionError } = await supabase.auth.getSession();

                if (sessionError) throw sessionError;

                if (mounted) {
                    setSession(session);
                    setUser(session?.user ?? null);
                    if (session?.user) {
                        await fetchUserProfile(session.user.id);
                    }
                }

                // 2. Suscribirse a cambios de auth
                const { data } = supabase.auth.onAuthStateChange(async (_event, session) => {
                    if (mounted) {
                        setSession(session);
                        setUser(session?.user ?? null);
                        if (session?.user) {
                            await fetchUserProfile(session.user.id);
                        } else {
                            setRole(null);
                        }
                        setLoading(false);
                    }
                });
                authSubscription = data.subscription;

            } catch (err) {
                if (mounted) {
                    setError(err as AuthError);
                    logError(err as Error, { component: 'AuthProvider', action: 'initialize' });
                }
            } finally {
                if (mounted) {
                    setLoading(false);
                }
            }
        }

        initializeAuth();

        return () => {
            mounted = false;
            if (authSubscription) {
                authSubscription.unsubscribe();
            }
        };
    }, []);

    // ✅ Iniciar sesión con Magic Link
    const signIn = async (email: string) => {
        try {
            const supabase = getSupabaseClient();
            const { error } = await supabase.auth.signInWithOtp({
                email,
                options: {
                    emailRedirectTo: window.location.origin,
                },
            });

            if (error) throw error;
            return { error: null };
        } catch (err) {
            logError(err as Error, { component: 'AuthProvider', action: 'signIn' });
            return { error: err as AuthError };
        }
    };

    // ✅ Iniciar sesión con Contraseña
    const signInWithPassword = async (email: string, password: string) => {
        try {
            const supabase = getSupabaseClient();
            const { error } = await supabase.auth.signInWithPassword({
                email,
                password,
            });

            if (error) throw error;
            return { error: null };
        } catch (err) {
            logError(err as Error, { component: 'AuthProvider', action: 'signInWithPassword' });
            return { error: err as AuthError };
        }
    };

    // ✅ Registrarse (Manual por Admin)
    const signUp = async (email: string, password: string) => {
        try {
            const supabase = getSupabaseClient();
            const { error } = await supabase.auth.signUp({
                email,
                password,
            });

            if (error) throw error;
            return { error: null };
        } catch (err) {
            logError(err as Error, { component: 'AuthProvider', action: 'signUp' });
            return { error: err as AuthError };
        }
    };

    // ✅ Cerrar sesión
    const signOut = async () => {
        try {
            const supabase = getSupabaseClient();
            const { error } = await supabase.auth.signOut();
            if (error) throw error;

            setUser(null);
            setSession(null);
            setRole(null);
            return { error: null };
        } catch (err) {
            logError(err as Error, { component: 'AuthProvider', action: 'signOut' });
            return { error: err as AuthError };
        }
    };

    const value = {
        user,
        session,
        role,
        loading,
        error,
        signIn,
        signInWithPassword,
        signUp,
        signOut,
        isAdmin: role === 'admin',
    };

    return <AuthContext.Provider value={value}>{children}</AuthContext.Provider>;
}

// ============================================================================
// HOOK
// ============================================================================

export function useAuth() {
    const context = useContext(AuthContext);
    if (context === undefined) {
        throw new Error('useAuth must be used within an AuthProvider');
    }
    return context;
}

import { describe, it, expect, vi, beforeEach } from 'vitest';
import { render, screen, waitFor, act } from '@testing-library/react';
import { AuthProvider, useAuth } from '../AuthContext';
import { createSupabaseMock } from '../../test/mocks/supabase.mock';

// 1. Setup Mock Hoisted - Correcto para evitar problemas de orden en Vitest
const { getSupabaseClientMock } = vi.hoisted(() => {
    return { getSupabaseClientMock: vi.fn() };
});

// 2. Mock Module - Ruta relativa exacta para coincidir con AuthContext
vi.mock('../../config/supabase', () => ({
    getSupabaseClient: getSupabaseClientMock,
}));

// Componente de Prueba - Expone el estado interno para verificar
const TestComponent = () => {
    const { user, loading, error, signIn, signInWithPassword, signUp, signOut } = useAuth();
    return (
        <div>
            <div data-testid="loading">{String(loading)}</div>
            <div data-testid="user-id">{user?.id || 'no-user'}</div>
            <div data-testid="error">{error?.message || 'no-error'}</div>

            <button onClick={() => signIn('magic@test.com')}>Sign In Magic</button>
            <button onClick={() => signInWithPassword('pass@test.com', 'password')}>Sign In Password</button>
            <button onClick={() => signUp('new@test.com', 'password')}>Sign Up</button>
            <button onClick={() => signOut()}>Sign Out</button>
        </div>
    );
};

describe('AuthContext Integration Tests', () => {
    let mockSupabase: ReturnType<typeof createSupabaseMock>;

    beforeEach(() => {
        vi.useRealTimers(); // Asegurar timers reales explícitamente
        vi.clearAllMocks();
        mockSupabase = createSupabaseMock();
        getSupabaseClientMock.mockReturnValue(mockSupabase);
    });

    it('should initialize successfully with session', async () => {
        // Mock session response
        mockSupabase.auth.getSession.mockResolvedValue({
            data: { session: { user: { id: 'test-user-init' } } },
            error: null,
        } as any);

        render(
            <AuthProvider>
                <TestComponent />
            </AuthProvider>
        );

        // Esperar que loading sea false y usuario esté presente
        await waitFor(() => {
            expect(screen.getByTestId('loading').textContent).toBe('false');
            expect(screen.getByTestId('user-id').textContent).toBe('test-user-init');
        });
    });

    it('should handle logic error during initialization', async () => {
        const errorMsg = 'Init failed';
        mockSupabase.auth.getSession.mockResolvedValue({
            data: { session: null },
            error: { message: errorMsg },
        } as any);

        render(
            <AuthProvider>
                <TestComponent />
            </AuthProvider>
        );

        await waitFor(() => {
            expect(screen.getByTestId('loading').textContent).toBe('false');
            expect(screen.getByTestId('error').textContent).toBe(errorMsg);
        });
    });

    it('should handle signIn with Magic Link', async () => {
        mockSupabase.auth.getSession.mockResolvedValue({ data: { session: null }, error: null } as any);
        mockSupabase.auth.signInWithOtp.mockResolvedValue({ error: null } as any);

        render(
            <AuthProvider>
                <TestComponent />
            </AuthProvider>
        );
        await waitFor(() => expect(screen.getByTestId('loading').textContent).toBe('false'));

        const btn = screen.getByText('Sign In Magic');
        await act(async () => {
            btn.click();
        });

        expect(mockSupabase.auth.signInWithOtp).toHaveBeenCalledWith({
            email: 'magic@test.com',
            options: expect.anything()
        });
    });

    it('should handle signIn with Password', async () => {
        mockSupabase.auth.getSession.mockResolvedValue({ data: { session: null }, error: null } as any);
        mockSupabase.auth.signInWithPassword.mockResolvedValue({ error: null } as any);

        render(
            <AuthProvider>
                <TestComponent />
            </AuthProvider>
        );
        await waitFor(() => expect(screen.getByTestId('loading').textContent).toBe('false'));

        const btn = screen.getByText('Sign In Password');
        await act(async () => {
            btn.click();
        });

        expect(mockSupabase.auth.signInWithPassword).toHaveBeenCalledWith({
            email: 'pass@test.com',
            password: 'password'
        });
    });

    it('should handle signOut', async () => {
        // Iniciar con usuario
        mockSupabase.auth.getSession.mockResolvedValue({
            data: { session: { user: { id: 'user-to-logout' } } },
            error: null,
        } as any);
        mockSupabase.auth.signOut.mockResolvedValue({ error: null } as any);

        render(
            <AuthProvider>
                <TestComponent />
            </AuthProvider>
        );
        await waitFor(() => expect(screen.getByTestId('user-id').textContent).toBe('user-to-logout'));

        const btn = screen.getByText('Sign Out');
        await act(async () => {
            btn.click();
        });

        expect(mockSupabase.auth.signOut).toHaveBeenCalled();
        // Verificar que el usuario se limpia (AuthContext lo hace manualmente en signOut)
        await waitFor(() => {
            expect(screen.getByTestId('user-id').textContent).toBe('no-user');
        });
    });
});
